n vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Qbc='Dienstag',Pwc='Dimension',Qic='Dimension [height=',dtc='DirectionalTextHelper',ecc='Do',Zbc='Do.',gtc='DockLayoutPanel',htc='DockLayoutPanel$Direction',itc='DockLayoutPanel$Direction;',ltc='DockLayoutPanel$DockAnimateCommand',jtc='DockLayoutPanel$LayoutData',spc='DomEvent',xpc='DomEvent$Type',Sbc='Donnerstag',xvc='Double',Rfc='EAST',_8b='EEE, d MMM yyyy HH:mm:ss Z',Flc='EEE. dd MMM. yyyy HH:mm:ss',t9b='EEEE d. MMMM',c9b='EEEE, d. MMMM y',v7b='EM',Wdc='EMPTY',_dc='ENABLED',rcc='END',x7b='EX',Orc='ElementMapperImpl',Prc='ElementMapperImpl$FreeNode',rbc='English',Eoc='Enum',ibc='Etc/GMT',kbc='Etc/GMT+',jbc='Etc/GMT-',Q7b='Event type',Duc='Event$NativePreviewEvent',Kpc='EventBus',Unc='EventObject',Znc='Exception',xec='Expecting version 6 from server, got ',N8b='F',Ojc='F8834F07517EF3B7D02B9E845E5E1B88',q7b='FIXED',Vec='FLOAT',wjc='Fail: ',Dac='Feb',Ibc='Feb.',xbc='Februar'
